sourcesContent:
import React from "react";
import {
  Card,
  CardContent,
  Typography,
  TextField,
  Button,
} from "@mui/material";
function Login() {
  return (
    // <>
    //   <Card sx={{ maxWidth: 450, margin: "auto", mt: 8, padding: 2 }}>
    //     <CardContent>
    //       <Typography variant="h5" component="div" gutterBottom>
    //         Login
    //       </Typography>
    //       <TextField
    //         label="email"
    //         margin="normal"
    //         variant="outlined"
    //         fullWidth
    //       ></TextField>
    //       <TextField
    //         label="password"
    //         margin="normal"
    //         variant="outlined"
    //         fullWidth
    //       ></TextField>
    //     </CardContent>
    //   </Card>
    // </>
    <>
      <div
        className="RealTimeChatMacAir"
        style={{
          width: 1280,
          height: 832,
          position: "relative",
          background: "#35465B",
        }}
      >
        <img
          className="Image2"
          style={{
            width: 1920,
            height: 969,
            left: 0,
            top: 0,
            position: "absolute",
          }}
          src="https://via.placeholder.com/1920x969"
        />
        <div
          className="Main"
          style={{
            width: 1205,
            height: 714,
            left: 56,
            top: 44,
            position: "absolute",
            background: "white",
            boxShadow: "0px 72px 80px -48px #223A28",
            borderRadius: 24,
            overflow: "hidden",
          }}
        >
          <div
            className="LoginContainer"
            style={{
              width: 550,
              height: 714,
              left: 0,
              top: 0,
              position: "absolute",
            }}
          >
            <div
              className="Rectangle3"
              style={{
                width: 550,
                height: 714,
                left: 0,
                top: 0,
                position: "absolute",
                background: "white",
              }}
            />
            <div
              className="WelcomeToChatRoomPleaseLoginToYourAccount"
              style={{
                width: 422,
                left: 64,
                top: 144,
                position: "absolute",
                color: "#355B3E",
                fontSize: 24,
                fontFamily: "Inter",
                fontWeight: "600",
                lineHeight: 36,
                wordWrap: "break-word",
              }}
            >
              Welcome to Chat-Room, Please login to your account
            </div>
            <div
              className="Frame13"
              style={{
                left: 64,
                top: 37,
                position: "absolute",
                justifyContent: "flex-start",
                alignItems: "center",
                gap: 16,
                display: "inline-flex",
              }}
            >
              <div
                className="ProiconsChat"
                style={{ width: 48, height: 48, position: "relative" }}
              >
                <div
                  className="Vector"
                  style={{
                    width: 37,
                    height: 37,
                    left: 5.5,
                    top: 5.5,
                    position: "absolute",
                    border: "1.50px black solid",
                  }}
                ></div>
              </div>
              <div
                className="ChatRoom"
                style={{
                  color: "#355B3E",
                  fontSize: 32,
                  fontFamily: "Inter",
                  fontWeight: "600",
                  lineHeight: 32,
                  wordWrap: "break-word",
                }}
              >
                Chat-Room
              </div>
            </div>
            <div
              className="LoginForm"
              style={{
                height: 296,
                left: 64,
                top: 280,
                position: "absolute",
                flexDirection: "column",
                justifyContent: "flex-start",
                alignItems: "flex-start",
                gap: 24,
                display: "inline-flex",
              }}
            >
              <div
                className="Email"
                style={{
                  alignSelf: "stretch",
                  height: 80,
                  flexDirection: "column",
                  justifyContent: "flex-start",
                  alignItems: "flex-start",
                  gap: 8,
                  display: "flex",
                }}
              >
                <div
                  className="Email"
                  style={{
                    alignSelf: "stretch",
                    color: "#2F3D4C",
                    fontSize: 16,
                    fontFamily: "Inter",
                    fontWeight: "600",
                    lineHeight: 16,
                    wordWrap: "break-word",
                  }}
                >
                  Email
                </div>
                <div
                  className="Frame2"
                  style={{
                    alignSelf: "stretch",
                    padding: 16,
                    background: "white",
                    borderRadius: 8,
                    border: "1px #B8D6BF solid",
                    justifyContent: "flex-start",
                    alignItems: "center",
                    gap: 8,
                    display: "inline-flex",
                  }}
                >
                  <div
                    className="RobertLangsterGmailCom"
                    style={{
                      flex: "1 1 0",
                      color: "#355B3E",
                      fontSize: 16,
                      fontFamily: "Inter",
                      fontWeight: "400",
                      lineHeight: 24,
                      wordWrap: "break-word",
                    }}
                  >
                    robert.langster@gmail.com
                  </div>
                </div>
              </div>
              <div
                className="Password"
                style={{
                  alignSelf: "stretch",
                  height: 80,
                  flexDirection: "column",
                  justifyContent: "flex-start",
                  alignItems: "flex-start",
                  gap: 8,
                  display: "flex",
                }}
              >
                <div
                  className="Password"
                  style={{
                    alignSelf: "stretch",
                    color: "#355B3E",
                    fontSize: 16,
                    fontFamily: "Inter",
                    fontWeight: "600",
                    lineHeight: 16,
                    wordWrap: "break-word",
                  }}
                >
                  Password
                </div>
                <div
                  className="Frame2"
                  style={{
                    alignSelf: "stretch",
                    padding: 16,
                    background: "white",
                    borderRadius: 8,
                    border: "1px #B8D6BF solid",
                    justifyContent: "flex-start",
                    alignItems: "center",
                    gap: 8,
                    display: "inline-flex",
                  }}
                >
                  <div
                    className="Frame14"
                    style={{
                      flex: "1 1 0",
                      height: 12,
                      justifyContent: "flex-start",
                      alignItems: "center",
                      gap: 4,
                      display: "flex",
                    }}
                  >
                    <div
                      className="Ellipse2"
                      style={{
                        width: 8,
                        height: 8,
                        background: "#355B3E",
                        borderRadius: 9999,
                      }}
                    />
                    <div
                      className="Ellipse3"
                      style={{
                        width: 8,
                        height: 8,
